There's no inflation; Time is bent.
We're still just an inch on from Ptolemy.

@EU_Commission .... all the above, only for some...
#ShameonEU
#CATALUNYA

@EU_Commission Democracy:
The Greek people voted against the Troika’s economic measures.
The day after their government is forced to accept even harder measures thanks to financial waterboarding by EU “Institutions”.
